import React from 'react';

const t = new Date();
const hr = t.getHours;
let sen = "";

if(hr<12){ sen = "Good Morning"; }
else if(hr>=12 && hr<16){  sen = "Good After Noon"; }
else if(hr>=16 && hr<18){ sen = "Good Evening"; }
else{  sen = "Good Night"; }


function Msg(){
    return(
      <h1> Hii Sir , {sen}</h1>
    );
}

export default Msg;
